export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:e,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:e,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},hdZ3ujNMNc:{data:{id:999,attributes:{imdbId:"tt7026672",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZTFiNzQ2OGUtYTdmMi00NjRjLWExN2MtZmNiODI4MTY3MGM3XkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"},{Source:"Rotten Tomatoes",Value:"63%"},{Source:"Metacritic",Value:"52\u002F100"}],item_lang:{data:{id:1662,attributes:{title:h,plot:"Based on David Levithan's acclaimed New York Times bestseller, Every Day tells the story of Rhiannon (Angourie Rice), a 16-year old girl who falls in love with a mysterious soul named \"A\" who inhabits a different body every day. Feeling an unmatched connection, Rhiannon and A work each day to find each other, not knowing what or who the next day will bring. The more the two fall in love, the more the realities of loving someone who is a different person every 24 hours takes a toll, leaving Rhiannon and \"A\" to face the hardest decision either has ever had to make.",slug:"every-day"}}},books:{data:[{id:875,attributes:{title:h,description:"THE NEW YORK TIMES BESTSELLER • NAMED ONE OF THE BEST BOOKS OF THE YEAR by Booklist • Kirkus Celebrate all the ways love makes us who we are with the romance that Entertainment Weekly calls \"wise, wildly unique\"--from the bestselling co-author of Nick and Norah's Infinite Playlist and Will Grayson, Will Grayson--about a teen who wakes up every morning in a different body, living a different life. Now a major motion picture! Every day a different body. Every day a different life. Every day in love with the same girl. There’s never any warning about where it will be or who it will be. A has made peace with that, even established guidelines by which to live: Never get too attached. Avoid being noticed. Do not interfere. It’s all fine until the morning that A wakes up in the body of Justin and meets Justin’s girlfriend, Rhiannon. From that moment, the rules by which A has been living no longer apply. Because finally A has found someone he wants to be with—day in, day out, day after day. With his new novel, David Levithan, bestselling co-author of Will Grayson, Will Grayson, and Nick and Norah's Infinite Playlist, has pushed himself to new creative heights. He has written a captivating story that will fascinate readers as they begin to comprehend the complexities of life and love in A’s world, as A and Rhiannon seek to discover if you can truly love someone who is destined to change every day. “A story that is always alluring, oftentimes humorous and much like love itself— splendorous.” —Los Angeles Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=56CTsaubhjAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2012-08-28",publisher:c,subtitle:d}},{id:876,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:f,published:l,publisher:c,subtitle:d}},{id:877,attributes:{title:"Six Earlier Days",description:"In Every Day, New York Times bestselling author David Levithan presented readers with his most ambitious novel to date: Every morning, A wakes up in a different body and leads a different life. A must never get too attached, must never be noticed, must never interfere. The novel Every Day starts on Day 5994 of A’s life. In this digital-only collection Six Earlier Days, Levithan gives readers a glimpse at a handful of the other 5993 stories yet to be told that inform how A navigates the complexities of a life lived anew each day. In Every Day, readers discover if you can truly love someone who is destined to change every day. In Six Earlier Days, readers will discover a little bit more about how A became that someone. Fans of Levithan’s books such as Nick & Norah’s Infinite Playlist, co-written with Rachel Cohn, and Will Grayson, Will Grayson, co-written with John Green, will not want to miss A’s adventures in Every Day and Six Earlier Days.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=w4jik_-DYgAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:f,published:"2012-11-26",publisher:c,subtitle:d}},{id:878,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:f,published:l,publisher:c,subtitle:d}},{id:879,attributes:{title:"Every You, Every Me",description:"A picture is worth a thousand lies in this psychological thriller by bestselling author David Levithan (Every Day; Will Grayson, Will Grayson with John Green). In this high school-set psychological tale, a tormented teen named Evan starts to discover a series of unnerving photographs—some of which feature him. Someone is stalking him . . . messing with him . . . threatening him. Worse, ever since his best friend Ariel has been gone, he's been unable to sleep, spending night after night torturing himself for his role in her absence. And as crazy as it sounds, Evan's starting to believe it's Ariel that's behind all of this, punishing him. But the more Evan starts to unravel the mystery, the more his paranoia and insomnia amplify, and the more he starts to unravel himself. Creatively told with black-and-white photos interspersed between the text so the reader can see the photos that are so unnerving to Evan, Every You, Every Me is a one-of-a-kind departure from a one-of-a-kind author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PJtKagdHU74C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:f,published:"2011-09-13",publisher:c,subtitle:d}}]}}},meta:{}}},prerenderedAt:1694069522586}}("movie","David Levithan","Knopf Books for Young Readers","","series",null,1,"Every Day","Another Day","NEW YORK TIMES BESTSELLER • Celebrate all the ways love makes us who we are with this enthralling and poignant follow-up to the New York Times bestseller Every Day--now a major motion picture. David Levithan turns his New York Times bestseller Every Day on its head by flipping perspectives in this exploration of love and how it can change you. Every day is the same for Rhiannon. She has accepted her life, convinced herself that she deserves her distant, temperamental boyfriend, Justin, even established guidelines by which to live: Don’t be too needy. Avoid upsetting him. Never get your hopes up. Until the morning everything changes. Justin seems to see her, to want to be with her for the first time, and they share a perfect day—a perfect day Justin doesn’t remember the next morning. Confused, depressed, and desperate for another day as great as that one, Rhiannon starts questioning everything. Then, one day, a stranger tells her that the Justin she spent that day with, the one who made her feel like a real person . . . wasn’t Justin at all.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uS6iBQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2015-08-25"))